define(function (require, exports, module){ 
	var $ = require('$');  
	function createCheckinDownImage(title,date,checkInName,checkInArea,qrimg,filename,callback){
		var canvas = window.document.createElement('canvas');//获取canvas对象
		canvas.setAttribute('width','2480');
		canvas.setAttribute('height','3508');
		if(canvas.getContext){
			var ctx = canvas.getContext('2d');
			var bg = new Image();
			bg.src =  createCheckinDownImage.bgbase;
			//绘制背景
			ctx.drawImage(bg, 0, 0);
			//绘制二维码 
			if(qrimg){ 
				ctx.drawImage(qrimg, 740, 1926);
			}
		 	//绘制 活动 标题
			ctx.font = "Bold 98px 黑体"; 
			ctx.textAlign = "center";
			ctx.fillStyle = "#000000"; 
			ctx.fillText(title, 1240, 335);  
			//绘制 活动 日期
			ctx.font = " 55px 黑体"; 
			ctx.textAlign = "center";
			ctx.fillStyle = "#000000"; 
			ctx.fillText(date, 1240, 445);  
			//绘制 活动 签到点
			ctx.font = "101px 黑体"; 
			ctx.textAlign = "center";
			ctx.fillStyle = "#000000"; 
			ctx.fillText(checkInName, 1240, 838); 
			//绘制 活动 签到点（地名）
			ctx.font = "138px 黑体"; 
			ctx.textAlign = "center";
			ctx.fillStyle = "#666"; 
			ctx.fillText(checkInArea, 1240, 1228); 
			//绘制 power by
			ctx.font = "12px 微软雅黑"; 
			ctx.textAlign = "right";
			ctx.fillStyle = "#FAFAFA"; 
			ctx.fillText("powered by hashmap.cn", 1240, 3490); 
			bg = null;
			ctx = null; 	
			//return canvas.toDataURL("image/png");
			// return canvas.toDataURL("image/png").replace("image/png", "image/octet-stream;Content-Disposition: attachment;filename="+filename+".png"); 
			//return canvas.toDataURL("image/png"); 
			//开始向服务器提交数据
			/*$.ajax({
				url:'/org/checkin/canvasdown',
				type:'post',
				data:{file:canvas.toDataURL("image/png")},
				success:function(msg){
					$("body").html(msg);		
				}
			});*/
			var form =$('<form target="_blank" action="/org/checkin/canvasdown" method="post"><input type="hidden" value="'+canvas.toDataURL("image/png")+'" name="file"><input type="hidden" name="filename" value="'+filename+'.png"></form>');
			form.submit(function(){
				if($.isFunction(callback)){
					callback.call(this);
				}
			});
			//alert("ADSFSADF");
			$('body').append(form);
			form.submit()
		}else{
			canvas = null;
			return false;
		}
	}
	exports.createCheckinDownImage = createCheckinDownImage;	
	createCheckinDownImage.bgbase = 'data:image/png;base64,';
});